import React, { useState } from "react";
import brand from "../../public/img/brand.png";

function Nav() {
  // function changeBackground(e) {
  //   e.target.style.background = 'black';
  // }
  // function changeBackground2(e) {
  //   e.target.style.background = '#161616';
  // }

  return (
    <div
      style={{
        backgroundColor: "#161616",
        // height: "950px",
        color: "white",
        textAlign: "center"
      }}
    >
      <title>Forms Ess</title>
      <link rel="preconnect" href="https://fonts.googleapis.com" />
      <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin />
      <link
        href="https://fonts.googleapis.com/css2?family=Dancing+Script&display=swap"
        rel="stylesheet"
      />
      <br />
      <br />
      {/* <Button kind="ghost" onMouseOver={changeBackground}
      onMouseOut={changeBackground2}>Button</Button>
      <Button kind="ghost" onMouseOver={changeBackground}
      onMouseOut={changeBackground2}>Button</Button>
      <Button kind="ghost" onMouseOver={changeBackground}
      onMouseOut={changeBackground2}>Button</Button>
      <Button kind="ghost" onMouseOver={changeBackground}
      onMouseOut={changeBackground2}>Button</Button>
      <Button kind="ghost" onMouseOver={changeBackground}
      onMouseOut={changeBackground2}>Button</Button>
      <Button kind="ghost" onMouseOver={changeBackground}
      onMouseOut={changeBackground2}>Button</Button>      
      <Button kind="ghost" onMouseOver={changeBackground}
      onMouseOut={changeBackground2}>Button</Button>
      <Button kind="ghost" onMouseOver={changeBackground}
      onMouseOut={changeBackground2}>Button</Button> */}

      <nav className="nav-main" style={{ display: "inline-flex" }}>
        {/* <!-- Brand --> */}
        <h1
          className="ess"
          style={{
            color: "#EABE3F",
            fontFamily: "Dancing Script",
            fontStyle: "italic",
            fontSize: "30px",
            display: "flex",
            justifyContent: "space-between",
            alignItems: "center",
            height: "50px",
            padding: "20px 0",
            marginRight: "4px"
          }}
        >
          Ess by{" "}
        </h1>
        <img
          src={brand}
          alt="IBM Logo"
          className="nav-brand"
          style={{ width: "60px" }}
        />

        {/* <!-- Left Nav --> */}
        <ul style={{ display: "flex" }}>
          <li style={{ padding: "5px", marginTop: "20px" }}>
            <a href="https://w3.ibm.com/#/">w3.ibm</a>
          </li>
          <li style={{ padding: "5px", marginTop: "20px" }}>
            <a href="https://rchc03e0.rch.stglabs.ibm.com/~sce/cgi-bin/CSCOrders.lcgi?fbclid=IwAR0PdNuHK2e0biupSGjQJ8vHin97AINgRazAfCbEpjP1hcOuWiJ5N4K0fGU">
              gum
            </a>
          </li>
          <li style={{ padding: "5px", marginTop: "20px" }}>
            <a href="http://smweb.gdl.mex.ibm.com:9080/Smart_Web/login.jsp?id=3141&error=fail&redirect=SMDashboards.jsp">
              Smart web
            </a>
          </li>
          <li style={{ padding: "5px", marginTop: "20px" }}>
            <a href="http://9.7.76.60/admin/">Adobera</a>
          </li>
          <li style={{ padding: "5px", marginTop: "20px" }}>
            <a href="http://calavera.gdl.mex.ibm.com/juanferm/soka/index.php?search=">
              Soka
            </a>
          </li>
          <li style={{ padding: "5px", marginTop: "20px" }}>
            <a href="https://ibm.ent.box.com/file/836180431015?s=nxts0d5x821clbcul381wwaatnpp2mqx">
              Status Box
            </a>
          </li>
          <li style={{ padding: "5px", marginTop: "20px" }}>
            <a href="https://www.humaneland.net/login/login.xhtml">
              Human eLand
            </a>
          </li>
        </ul>

        {/* <!-- Right Nav --> */}
        <ul class="nav-menu-right">
          <li>
            <a>
              <i class="fas fa-search"></i>
            </a>
          </li>
        </ul>
      </nav>
      <hr style={{ border: "transparent" }} />
    </div>
  );
}

export default Nav;
